import LiveChatIcon from "./LiveChatIcon";
import LiveChatPopup from "./LiveChatPopup";

const LiveChat = () => {
  return (
    <>
      <div>
        <LiveChatPopup />
        <LiveChatIcon />
      </div>
    </>
  );
};

export default LiveChat;
